Nice Cup of Tea

Travel Documentary hosted by Victoria Wood, published by BBC in 2013 - English narration


Information
------------------------------

Victoria Wood travels the globe to explore Britain's love affair with tea in a two part special on the little plant that changed the world. What is it about tea we love so much, and how did we all end up hooked?

1.
From the back streets of Kolkata to the mega city of Shanghai, Victoria reveals how the cozy cuppa united east and west, triggered wars and helped us win them. Along the way she peeks into a fascinating world of chai wallahs, opium smokers, Assam tea pickers and grumpy elephants. She asks: how did this strange exotic leaf become such an important part of British life?

2.
Victoria visits Woburn Abbey, Blackpool and Harrogate - where she mugs up on the history - and learns how to slurp and spit. She shares a cuppa with Graham Norton and Doctor Who actor Matt Smith. In New York, home of the tea bag, she warms the pot with musician and self-confessed tea addict Morrissey.

